import React, { useState, useEffect } from "react";
import { useLocation } from "react-router-dom";
import "../Layout.css";

const lakes = [
  {
    key: "Lugnet",
    name: "Lugnet",
    lat: 59.11778189893817,
    lon: 15.232421965429385,
    rules: [
      "I Lugnet √§r det flugfiske och Catch & Release som g√§ller och man anv√§nder en hullingsl√∂s enkelkrok.",
      "Fisket f√•r forts√§tta s√• l√§nge man √•ters√§tter fisken som √§r i bra kondition.",
      "Den person som st√•r p√• fiskekortet har r√§tten att fiska i den sj√∂ som fiskekortet g√§ller.",
      "Endast ett fiskeredskap √§r till√•tet per fiskekort!",
      "Till√•tna fiskemetoder √§r endast flugfiske med hullingl√∂s enkelkrok. Endast en upph√§ngare √§r till√•tet och ryckfiske √§r f√∂rbjudet."
    ],
    address: "Kommer snart, Kumla kommun"
  },
  {
    key: "S√§bylundssj√∂n",
    name: "S√§bylundssj√∂n",
    lat: 59.16460436303601,
    lon: 15.15388129762814,
    rules: [
      "Max 2 fiskar per dag",
      "Endast mete till√•tet",
      "Fiskekort kr√§vs f√∂r all fisk"
    ],
    address: "Kommer snart, Kumla kommun"
  },
  {
    key: "Nolsj√∂n",
    name: "Nolsj√∂n",
    lat: 59.14149881510971,
    lon: 14.56810353864065,
    rules: [
      "Catch & release",
      "Ingen n√§tfiske",
      "Max 3 fiskar per dag"
    ],
    address: "Kommer snart, Kumla kommun"
  }
];

function Rules() {
  const location = useLocation();
  const [selectedLake, setSelectedLake] = useState(null);
  const [weatherData, setWeatherData] = useState(null);

  useEffect(() => {
    const params = new URLSearchParams(location.search);
    const lakeKey = params.get("lake");
    const lake = lakes.find(l => l.key === lakeKey);
    if (lake) setSelectedLake(lake);
  }, [location]);

  useEffect(() => {
    if (selectedLake) {
      fetch(
        `https://api.open-meteo.com/v1/forecast?latitude=${selectedLake.lat}&longitude=${selectedLake.lon}&current=temperature_2m,precipitation,precipitation_probability,weathercode`
      )
        .then(res => res.json())
        .then(data => {
          const current = data.current;
          setWeatherData({
            temp: current.temperature_2m,
            precipProb: current.precipitation_probability ?? 0,
            code: current.weathercode
          });
        })
        .catch(console.error);
    }
  }, [selectedLake]);

  const getWeatherIcon = (code) => {
    if (!code) return "‚òÅÔ∏è";
    if (code < 3) return "‚òÄÔ∏è";
    if (code < 50) return "üå§Ô∏è";
    if (code < 60) return "üåßÔ∏è";
    if (code < 70) return "‚õàÔ∏è";
    if (code < 80) return "‚ùÑÔ∏è";
    return "üå´Ô∏è";
  };

  return (
    <div className="rules-container">
      <div className="outer-card">
        <h1>{selectedLake ? selectedLake.name : "V√§lj sj√∂"}</h1>

        <div className="inner-card">
          {!selectedLake && (
            <div style={{ display: "flex", gap: "10px", flexWrap: "wrap", marginBottom: "20px" }}>
              {lakes.map(lake => (
                <button
                  key={lake.key}
                  onClick={() => setSelectedLake(lake)}
                  style={{
                    padding: "10px 15px",
                    cursor: "pointer",
                    borderRadius: "6px",
                    border: "1px solid #0077cc",
                    backgroundColor: "#fff",
                    color: "#0077cc",
                    fontWeight: "600",
                    transition: "all 0.3s"
                  }}
                  onMouseEnter={e => {
                    e.currentTarget.style.backgroundColor = "#0077cc";
                    e.currentTarget.style.color = "#fff";
                  }}
                  onMouseLeave={e => {
                    e.currentTarget.style.backgroundColor = "#fff";
                    e.currentTarget.style.color = "#0077cc";
                  }}
                >
                  {lake.name}
                </button>
              ))}
            </div>
          )}

          {selectedLake && (
            <div>
              <ul>
                <h2 style={{ fontWeight: 700, marginBottom: "16px" }}>Regler f√∂r {selectedLake.name}</h2>
                {selectedLake.rules.map((rule, index) => (
                  <li key={index} style={{ fontWeight: 600, wordWrap: "break-word", overflowWrap: "break-word", marginBottom: "8px" }}>
                    {rule}
                  </li>
                ))}
              </ul>

              <p style={{ fontWeight: 700, marginTop: "12px" }}>
                Adress: {selectedLake.address}
              </p>

              {weatherData && (
                <div className="weather-card">
                  <h3>V√§der just nu</h3>
                  <div style={{ fontSize: "48px" }}>{getWeatherIcon(weatherData.code)}</div>
                  <p>Temperatur: {weatherData.temp}¬∞C</p>
                  <p>Regnchans: {weatherData.precipProb}%</p>
                </div>
              )}
            </div>
          )}
        </div>
      </div>
    </div>
  );
}

export default Rules;
